% conformal mapping, new polar coordinates
function [rho, Teta] = calc_cyl(r,Fi_rad)

r0 = 3.95; % domain under cargo radius
Rm = 50; % membrane radius
a = 10; % distance between membrane center and cargo center

Qplus = Rm^2 + a^2 - r0^2 + sqrt( (Rm^2 + a^2 - r0^2)^2 - 4*a^2*Rm^2 );
Qminus = Rm^2 + a^2 - r0^2 - sqrt( (Rm^2 + a^2 - r0^2)^2 - 4*a^2*Rm^2 );
k = Qplus/(2*a*Rm);
rho_up = 4*a^2*r.^2 + 4*a*Qminus*r.*cos(Fi_rad) + Qminus^2;
rho_down = 4*a^2*r.^2 + 4*a*Qplus*r.*cos(Fi_rad) + Qplus^2;
rho = k*sqrt( rho_up./rho_down );
Teta_up = r*sqrt( ( Rm^2+a^2-r0^2 )^2 - 4*Rm^2*a^2 ).*sin(Fi_rad);
Teta_down = a*(Rm^2+r.^2) + r*(Rm^2+a^2-r0^2).*cos(Fi_rad);
Teta = atan2( Teta_up,Teta_down );

end


%function [coeffs] = solve_se(rho, Teta, hexp)
function solve_se(rho, Teta, hexp)

R = 1.0;
% create system matrix and right part 
L = [0; 0; 0; 0; 0; 0;];

for i=1:size(rho)

    L(1) = L(1) + (R - rho(i))^2/rho(i)^2;
    L(2) = L(2) + cos(Teta(i))*(R - rho(i))^2/rho(i);
    L(3) = L(3) - hexp(i)*(R - rho(i))/rho(i);
    L(4) = L(4) + cos(Teta(i))^2*(R - rho(i))^2;
    L(5) = L(5) - hexp(i)*(R - rho(i))*cos(Teta(i));

end

syms A0 A1 R0
F1 = A0*R0^2*L(1)/(R-R0)^2 + A1*R0*L(2)/(R-R0)^2 + R0*L(3)/(R-R0);
F2 = A0*R0*L(2)/(R-R0)^2 + A1*L(4)/(R-R0)^2 + L(5)/(R-R0);
F3 = A0^2*R0*L(1)*R/(R-R0)^3 + A0*A1*L(2)*R/(R-R0)^3 + A0*L(3)*R/(R-R0)^2 + A0*A1*R0*L(2)/(R-R0)^3 + A1^2*L(4)/(R-R0)^3 + A1*L(5)/(R-R0)^2;
sol = solve(F1,F2,F3);
double(sol.A0)
double(sol.A1)
double(sol.R0)

%eqs = [F1, F2, F3];
%[A0,A1,R0]=vpasolve(eqs,[A0,A1,R0])

end

function solve_se_2(rho, Teta, hexp)

% R = 1.0;
% create system matrix and right part 
L = [0; 0; 0; 0; 0; 0; 0];

for i=1:size(rho)

    L(1) = L(1) + (1 - rho(i))^2/rho(i)^2;
    L(2) = L(2) + cos(Teta(i))*(1 - rho(i))^2/rho(i);
    L(4) = L(4) - hexp(i)*(1 - rho(i))/rho(i);
    L(5) = L(5) + cos(Teta(i))^2*(1 - rho(i))^2;
    L(7) = L(7) - hexp(i)*(1 - rho(i))*cos(Teta(i));

end

syms F1(A0,A1,A2,R0)
F1(A0,A1,A2,R0)= A0*R0^2*L(1)/(1-R0)^2 + A1*R0*L(2)/(1-R0)^2 + R0*L(4)/(1-R0);
syms F2(A0,A1,A2,R0)
F2(A0,A1,A2,R0) = A0*R0*L(2)/(1-R0)^2 + A1*L(5)/(1-R0)^2 + L(7)/(1-R0);
syms F3(A0,A1,A2,R0)
F3(A0,A1,A2,R0) = 0;
syms F4(A0,A1,A2,R0)
F4(A0,A1,A2,R0) = A0^2*R0*L(1)/(1-R0)^3 + A0*A1*L(2)*(R0 + 1)/(1-R0)^3 + A1^2*L(5)/(1-R0)^3 + A0*L(4)/(1-R0)^2 + A1*L(7)/(1-R0)^2;

for i=1:size(rho)
    
    F1(A0,A1,A2,R0) = F1(A0,A1,A2,R0) + A2*R0^2*(1/(1-R0)^2)*(1-rho(i))^2*cos(2*Teta(i))/(rho(i)*(4*R0-3*rho(i)));

    F2(A0,A1,A2,R0) = F2(A0,A1,A2,R0) + A2*R0*(1/(1-R0)^2)*(1-rho(i))^2*cos(2*Teta(i))/(4*R0-3*rho(i));
    
    F3(A0,A1,A2,R0) = F3(A0,A1,A2,R0) + A0*R0^2*(1/(1-R0)^2)*(1-rho(i))^2*cos(2*Teta(i))/(rho(i)*(4*R0-3*rho(i))) + ...
        A1*R0*(1/(1-R0)^2)*(1-rho(i))^2*cos(Teta(i))*cos(2*Teta(i))/(4*R0-3*rho(i)) + ...
        A2*R0^2*(1/(1-R0)^2)*(1-rho(i))^2*cos(2*Teta(i))^2/(4*R0-3*rho(i))^2 + ...
        R0*(1/(1-R0))*(-hexp(i))*(1-rho(i))*cos(2*Teta(i))/(4*R0-3*rho(i));
    
    F4(A0,A1,A2,R0) = F4(A0,A1,A2,R0) + 2*A0*A2*R0*(1/(1-R0)^3)*(1-rho(i))^2*cos(2*Teta(i))/(rho(i)*(4*R0-3*rho(i))) + ...
        A1*A2*(R0+1)/(1/(1-R0)^3)*(1-rho(i))^2*cos(Teta(i))*cos(2*Teta(i))/(4*R0-3*rho(i)) + ...
        A2^2*R0/(1/(1-R0)^3)*(1-rho(i))^2*cos(2*Teta(i))^2/(4*R0-3*rho(i))^2 + ...
        A2*(1/(1-R0)^2)*(-hexp(i))*(1-rho(i))*cos(2*Teta(i))/(4*R0-3*rho(i));
    
end


U1 = F1(A0,A1,A2,R0);
U2 = F2(A0,A1,A2,R0);
U3 = F3(A0,A1,A2,R0);
U4 = F4(A0,A1,A2,R0);

format short
pretty(vpa(U1,6))

%sol = solve(U1,U2,U3,U4);
%double(sol.A0)
%double(sol.A1)
%double(sol.A2)
%double(sol.R0)

nU1 = vpa(U1,6)
nU2 = vpa(U2,6)
nU3 = vpa(U3,6)
nU4 = vpa(U4,6)

%eqs = [nU1, nU2, nU3, nU4];
%[nA0,nA1,nA2,nR0]=vpasolve(eqs,[A0,A1,A2,R0])

end

function solve_se_3_eq(rho, Teta, hexp)

% R = 1.0;
% create system matrix and right part 
L = [0; 0; 0; 0; 0; 0; 0];

for i=1:size(rho)

    L(1) = L(1) + (1 - rho(i))^2/rho(i)^2;
    L(2) = L(2) + cos(Teta(i))*(1 - rho(i))^2/rho(i);
    L(4) = L(4) - hexp(i)*(1 - rho(i))/rho(i);
    L(5) = L(5) + cos(Teta(i))^2*(1 - rho(i))^2;
    L(7) = L(7) - hexp(i)*(1 - rho(i))*cos(Teta(i));

end

syms a1(R0)
a1(R0) = R0^2*L(1)/(1-R0)^2;
syms b1(R0)
b1(R0) = R0*L(2)/(1-R0)^2;
syms c1(R0)
c1(R0) = 0;
syms d1(R0)
d1(R0) = -R0*L(4)/(1-R0);

syms a2(R0)
a2(R0) = R0*L(2)/(1-R0)^2;
syms b2(R0)
b2(R0) = L(5)/(1-R0)^2;
syms c2(R0)
c2(R0) = 0;
syms d2(R0)
d2(R0) = -L(7)/(1-R0);

syms a3(R0)
a3(R0) = 0;
syms b3(R0)
b3(R0) = 0;
syms c3(R0)
c3(R0) = 0;
syms d3(R0)
d3(R0) = 0;

for i=1:size(rho)
    
    c1(R0) = c1(R0) + R0^2*(1/(1-R0)^2)*(1-rho(i))^2*cos(2*Teta(i))/(rho(i)*(4*R0-3*rho(i)));
    
    c2(R0) = c2(R0) + R0*(1/(1-R0)^2)*(1-rho(i))^2*cos(2*Teta(i))/(4*R0-3*rho(i));

    a3(R0) = a3(R0) + R0^2*(1/(1-R0)^2)*(1-rho(i))^2*cos(2*Teta(i))/(rho(i)*(4*R0-3*rho(i)));
    
    b3(R0) = b3(R0) + R0*(1/(1-R0)^2)*(1-rho(i))^2*cos(Teta(i))*cos(2*Teta(i))/(4*R0-3*rho(i));
    
    c3(R0) = c3(R0) + R0^2*(1/(1-R0)^2)*(1-rho(i))^2*cos(2*Teta(i))^2/(4*R0-3*rho(i))^2;
    
    d3(R0) = d3(R0) -R0*(1/(1-R0))*(-hexp(i))*(1-rho(i))*cos(2*Teta(i))/(4*R0-3*rho(i));
    
end

Z = ( (d3(R0)-a3(R0)*d1(R0)/a1(R0))*(b2(R0)-b1(R0)*a2(R0)/a1(R0)) - (b3(R0)-b1(R0)*a3(R0)/a1(R0))*(d2(R0)-a2(R0)*d1(R0)/a1(R0)) ) / ( -(b3(R0)-b1(R0)*a3(R0)/a1(R0))*(c2(R0)-c1(R0)*a2(R0)/a1(R0)) + (b2(R0)-b1(R0)*a2(R0)/a1(R0))*(c3(R0)-c1(R0)*a3(R0)/a1(R0)) );
Y = (d2(R0)-a2(R0)*d1(R0)/a1(R0))/(b2(R0)-b1(R0)*a2(R0)/a1(R0)) - Z*(c2(R0)-c1(R0)*a2(R0)/a1(R0))/(b2(R0)-b1(R0)*a2(R0)/a1(R0));
X = d1(R0)/a1(R0) - Y*b1(R0)/a1(R0) - Z*c1(R0)/a1(R0);

format short
nU1 = vpa(X,6)
nU2 = vpa(Y,6)
nU3 = vpa(Z,6)

syms F(X,Y,Z,R0)
F(X,Y,Z,R0) = X^2*R0*L(1)/(1-R0)^3 + X*Y*L(2)*(R0 + 1)/(1-R0)^3 + Y^2*L(5)/(1-R0)^3 + X*L(4)/(1-R0)^2 + Y*L(7)/(1-R0)^2;

for i=1:size(rho)
    
    F(X,Y,Z,R0) = F(X,Y,Z,R0) + 2*X*Z*R0*(1/(1-R0)^3)*(1-rho(i))^2*cos(2*Teta(i))/(rho(i)*(4*R0-3*rho(i))) + ...
        Y*Z*(R0+1)/(1/(1-R0)^3)*(1-rho(i))^2*cos(Teta(i))*cos(2*Teta(i))/(4*R0-3*rho(i)) + ...
        Z^2*R0/(1/(1-R0)^3)*(1-rho(i))^2*cos(2*Teta(i))^2/(4*R0-3*rho(i))^2 + ...
        Z*(1/(1-R0)^2)*(-hexp(i))*(1-rho(i))*cos(2*Teta(i))/(4*R0-3*rho(i));
    
end

%pretty(vpa(Z,6))
myeqv = F(X,Y,Z,R0);
nU4 = vpa(myeqv,6)

end

function solve_se_3_eq_final(rho, Teta, hexp)

R0 = 1.77452;
% R = 1.0;
% create system matrix and right part 
L = [0; 0; 0; 0; 0; 0; 0];

for i=1:size(rho)

    L(1) = L(1) + (1 - rho(i))^2/rho(i)^2;
    L(2) = L(2) + cos(Teta(i))*(1 - rho(i))^2/rho(i);
    L(4) = L(4) - hexp(i)*(1 - rho(i))/rho(i);
    L(5) = L(5) + cos(Teta(i))^2*(1 - rho(i))^2;
    L(7) = L(7) - hexp(i)*(1 - rho(i))*cos(Teta(i));

end

syms F1(A0,A1,A2)
F1(A0,A1,A2)= A0*R0^2*L(1)/(1-R0)^2 + A1*R0*L(2)/(1-R0)^2 + R0*L(4)/(1-R0);
syms F2(A0,A1,A2)
F2(A0,A1,A2) = A0*R0*L(2)/(1-R0)^2 + A1*L(5)/(1-R0)^2 + L(7)/(1-R0);
syms F3(A0,A1,A2)
F3(A0,A1,A2) = 0;

for i=1:size(rho)
    
    F1(A0,A1,A2) = F1(A0,A1,A2) + A2*R0^2*(1/(1-R0)^2)*(1-rho(i))^2*cos(2*Teta(i))/(rho(i)*(4*R0-3*rho(i)));

    F2(A0,A1,A2) = F2(A0,A1,A2) + A2*R0*(1/(1-R0)^2)*(1-rho(i))^2*cos(2*Teta(i))/(4*R0-3*rho(i));
    
    F3(A0,A1,A2) = F3(A0,A1,A2) + A0*R0^2*(1/(1-R0)^2)*(1-rho(i))^2*cos(2*Teta(i))/(rho(i)*(4*R0-3*rho(i))) + ...
        A1*R0*(1/(1-R0)^2)*(1-rho(i))^2*cos(Teta(i))*cos(2*Teta(i))/(4*R0-3*rho(i)) + ...
        A2*R0^2*(1/(1-R0)^2)*(1-rho(i))^2*cos(2*Teta(i))^2/(4*R0-3*rho(i))^2 + ...
        R0*(1/(1-R0))*(-hexp(i))*(1-rho(i))*cos(2*Teta(i))/(4*R0-3*rho(i));
    
end

U1 = F1(A0,A1,A2);
U2 = F2(A0,A1,A2);
U3 = F3(A0,A1,A2);

format long
%pretty(vpa(U1,6))

sol = solve(U1,U2,U3);
double(sol.A0)
double(sol.A1)
double(sol.A2)

end

